sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var response = JSON.parse(inputs.response);
var fileId = "";
if(response.documents && response.documents.length > 0){
    var document = response.documents[0];
    if(document.resultFiles && document.resultFiles.length > 0){
        fileId = document.resultFiles[0].fileId.toString();
    }
}
//var out = response.documents[0].resultFiles[0].fileId.toString();
//var status = response.status.toString();
//outputs.status = status;
outputs.fileid = fileId;
})(inputs, outputs);

