sys_variable_value.value:
(function execute(inputs, outputs) {
    var transactionID = JSON.parse(inputs.response)["transactionId"];
    
    var baseURL = "https://vantage-us.abbyy.com/api/publicapi/v1/transactions/<transactionId>";
    baseURL = baseURL.replace("<transactionId>", transactionID);
    outputs.base_url = baseURL;
    outputs.transactionid = transactionID
})(inputs, outputs);

